import React from "react";
import KanjiData from "./kanjidata";

const Kanji = () => {
    const KData = KanjiData.kanji_data;
    console.log(KData);
    return (
        <div>
            {KData.map((data, key) => {
                <div key={key}> 
                    <p>data.jlpt</p>
                </div>
            })}
        </div>
    )
}

export default Kanji;
